import styled from 'styled-components';

export const MapContainerStyle = styled.div`
  background: #ECECEC;
  margin: 2px;
  width:50%;
  float:left;
  .search-container {
    position: fixed;
    z-index: 10;
    left: 0;
    background: #c7e9c7;
    height: 40px;
    width: 200px;
    bottom: 0;
  }
`;
